description:
The 5th volume of Sweetheart's popular series features a stunning cast of bombshell older and younger ladies. Cutie Lola Foxx takes over housekeeping duties for her mom, and becomes very attracted to Darla Crane, the lady of the house. Bratty stepdaughter Alina Li drives stepmom Zoey Holloway crazy, and pushes things way too far when she steals her new mom's rare, limited edition sex toy. Nanny Penny Pax harbors a heavy crush on Alana Evans...meanwhile, Alana thinks that Penny's crush is on Alana's husband. Everything becomes clear in the hottest way possible. Finally, concerned stepmom Veronica Avluv confronts sullen stepdaughter Pepper Kester about a possible eating disorder. Veronica helps Pepper to see how lovely the younger girl is, and Pepper returns the gesture with orgasm after orgasm.

